module.exports = {
  root: true,
  extends: [
    '@react-native',
    'plugin:prettier/recommended',
    'plugin:jest/recommended',
  ],
  rules: {
    'no-console': ['error', { allow: ['warn', 'error'] }],
  },
  ignorePatterns: ['lib/*', 'node_modules/*', '**/build/*'],
};

module.exports = {
  quoteProps: 'consistent',
  singleQuote: true,
  tabWidth: 2,
  trailingComma: 'all',
  useTabs: false,
};

module.exports = {
  presets: ['@react-native/babel-preset'],
};

{
  "platforms": [
    "ios"
  ],
  "ios": {
    "appDelegateSubscribers": ["GoogleSignInAppDelegate"],
    "podspecPath": "expo/ios/ExpoAdapterGoogleSignIn.podspec"
  }
}

// @flow
import * as React from 'react';
import { typeof View } from 'react-native';

export type ConfigureParams = $ReadOnly<{|
  iosClientId?: string,
  googleServicePlistPath?: string,
  offlineAccess?: boolean,
  webClientId?: string,
  scopes?: string[],
  hostedDomain?: string,
  forceCodeForRefreshToken?: boolean,
  accountName?: string,
  openIdRealm?: string,
  profileImageSize?: number,
|}>;

export type SignInParams = $ReadOnly<{|
  loginHint?: string,
|}>;

export type AddScopesParams = $ReadOnly<{|
  /**
   * The Google API scopes to request access to. Default is email and profile.
   */
  scopes?: string[],
|}>;

export type GoogleSigninButtonProps = $ReadOnly<{|
  ...React.ElementConfig<View>,
  size?: number,
  color?: string,
  disabled?: boolean,
  onPress?: () => any,
|}>;

declare export class GoogleSigninButton extends React.Component<GoogleSigninButtonProps> {
  static Size: {
    Icon: number,
    Standard: number,
    Wide: number,
  };

  static Color: {
    Auto: string,
    Light: string,
    Dark: string,
  };
}

export type HasPlayServicesParams = $ReadOnly<{|
  showPlayServicesUpdateDialog: boolean,
|}>;

export type User = {|
  user: {|
    id: string,
    name: ?string, // full name
    email: string,
    photo: ?string, // url
    familyName: ?string,
    givenName: ?string,
  |},
  scopes: string[], // on iOS this is empty array if no additional scopes are defined
  idToken: string,
  /**
   * Not null only if a valid webClientId and offlineAccess: true was
   * specified in configure().
   */
  serverAuthCode: ?string,
|};

// Android Status codes: https://developers.google.com/android/reference/com/google/android/gms/auth/api/signin/GoogleSignInStatusCodes
type StatusCodes = $ReadOnly<{
  SIGN_IN_CANCELLED: string,
  IN_PROGRESS: string,
  PLAY_SERVICES_NOT_AVAILABLE: string,
  SIGN_IN_REQUIRED: string,
}>;

declare export var statusCodes: StatusCodes;

export type SignInSuccessResponse = {|
  type: 'success';
  data: User;
|};
export type CancelledResponse = {|
  type: 'cancelled';
  data: null;
|};
export type NoSavedCredentialFound = {|
  type: 'noSavedCredentialFound';
  data: null;
|};
export type SignInResponse = SignInSuccessResponse | CancelledResponse;
export type SignInSilentlyResponse =
  | SignInSuccessResponse
  | NoSavedCredentialFound;

// the functions are not static class functions in fact
// but using static keyword works well for this case
declare export class GoogleSignin {
  static hasPlayServices: (params?: HasPlayServicesParams) => Promise<boolean>;
  static configure: (params?: ConfigureParams) => void;
  static signInSilently: () => Promise<SignInSilentlyResponse>;
  static signIn: (params?: SignInParams) => Promise<SignInResponse>;
  static addScopes: (params: AddScopesParams) => Promise<SignInResponse | null>;
  static signOut: () => Promise<null>;
  static revokeAccess: () => Promise<null>;
  static hasPreviousSignIn: () => boolean;
  static getCurrentUser(): User | null;
  static clearCachedAccessToken(token: string): Promise<null>;
  static getTokens(): Promise<{ idToken: string, accessToken: string }>;
}

/** @type {import('jest').Config} */
const config = {
  preset: 'react-native',
  modulePathIgnorePatterns: [
    '<rootDir>/example/node_modules',
    '<rootDir>/lib/',
  ],
  moduleNameMapper: {
    '@react-native-google-signin/google-signin': '<rootDir>/src/index.ts',
  },
};

module.exports = config;

const path = require('path');

const exclusionList = require('metro-config/src/defaults/exclusionList');

const blockList = exclusionList([
  /node_modules\/.*\/node_modules\/react-native\/.*/,

  // This stops "react-native run-windows" from causing the metro server to
  // crash if its already running
  new RegExp(`${path.join(__dirname, 'windows').replace(/[/\\]+/g, '/')}.*`),

  // Workaround for `EPERM: operation not permitted, lstat '~\midl-MIDLRT-cl.read.1.tlog'`
  /.*\.tlog/,

  // Prevent Metro from watching temporary files generated by Visual Studio
  // otherwise it may crash when they are removed when closing a project.
  /.*\/.vs\/.*/,

  // Workaround for `EBUSY: resource busy or locked, open '~\msbuild.ProjectImports.zip'`
  /.*\.ProjectImports\.zip/,
]);

const config = {
  projectRoot: path.join(__dirname, 'example'),
  watchFolders: [__dirname],
  resolver: {
    blockList,
    // for some reason, since 0.73, metro does not see this
    extraNodeModules: {
      '@react-native-google-signin/google-signin': __dirname,
    },
  },
};

// Starting with react-native 0.72, we are required to provide a full config.
const { getDefaultConfig, mergeConfig } = require('@react-native/metro-config');
module.exports = mergeConfig(getDefaultConfig(__dirname), config);

const path = require('path');

const project = (() => {
  try {
    const { configureProjects } = require('react-native-test-app');
    return configureProjects({
      android: {
        sourceDir: path.join('example', 'android'),
      },
      ios: {
        sourceDir: path.join('example', 'ios'),
      },
    });
  } catch (_) {
    return undefined;
  }
})();

module.exports = {
  dependencies: {
    // Help rn-cli find and autolink this library
    '@react-native-google-signin/google-signin': {
      root: __dirname,
    },
    ...(project
      ? {
          expo: {
            // otherwise RN cli will try to autolink expo
            platforms: {
              ios: null,
              android: null,
            },
          },
        }
      : undefined),
  },
  ...(project ? { project } : undefined),
};

const join = require('path').join;
const readFileSync = require('fs').readFileSync;

module.exports = {
  branches: ['master'],
  plugins: [
    '@semantic-release/commit-analyzer',
    [
      '@semantic-release/release-notes-generator',
      {
        writerOpts: {
          footerPartial: readFileSync(
            join(__dirname, '.github/footer.hbs'),
            'utf-8',
          ),
        },
      },
    ],
    '@semantic-release/npm',
    '@semantic-release/github',
    [
      '@semantic-release/git',
      {
        assets: 'package.json',
        message:
          'chore(release): ${nextRelease.version} [skip ci]\n\n${nextRelease.notes}',
      },
    ],
  ],
};

{
  "extends": "./tsconfig",
  "exclude": ["example"]
}
